import React from 'react';

import { Result, Button } from 'antd';

const ResultEmpty = () => (
  <Result
    status="404"
    title="Your cart Empty"
    subTitle="Sorry, the page you visited does not exist."
    extra={<Button type="primary">Go Shopping NOW</Button>}
  />
);
export default ResultEmpty;
